var array = [];
var colors = {
    rosso: '#FF0000',
    blu: '#0000FF',
    verde: '#00FF00',
    grigio: '#C8C8C8FF'
};
var defaultColor = '#C8C8C8FF';

// Definisci gli ID dei semafori e i rispettivi colori associati
var semafori = [
    { id: 'id_cella_5_rosso', colorKey: 'verde', negate: true },
    { id: 'id_cella_5_giallo', colorKey: 'blu' },
    { id: 'id_cella_5_verde', colorKey: 'verde' },
    { id: 'id_cella_6_rosso', colorKey: 'verde', negate: true },
    { id: 'id_cella_6_giallo', colorKey: 'blu' },
    { id: 'id_cella_6_verde', colorKey: 'verde' },
    { id: 'id_cella_7_rosso', colorKey: 'verde', negate: true },
    { id: 'id_cella_7_giallo', colorKey: 'blu' },
    { id: 'id_cella_7_verde', colorKey: 'verde' },
    { id: 'id_cella_8_rosso', colorKey: 'verde', negate: true },
    { id: 'id_cella_8_giallo', colorKey: 'blu' },
    { id: 'id_cella_8_verde', colorKey: 'verde' },
    { id: 'id_cella_9_rosso', colorKey: 'verde', negate: true },
    { id: 'id_cella_9_giallo', colorKey: 'blu' },
    { id: 'id_cella_9_verde', colorKey: 'verde' }
];

for (var i = 0; i < semafori.length; i++) {
    var semaforo = semafori[i];
    var aux = global.get(semaforo.id);
    var color = semaforo.negate ? (aux ? colors[semaforo.colorKey] : colors.rosso) : (aux ? colors[semaforo.colorKey] : colors.grigio);

    var json = {
        "command": "update_style",
        "selector": sym.concat(semaforo.id),
        "attributeName": "fill",
        "attributeValue": color || defaultColor
    };

    array.push(json);
}

msg.payload = array;
msg.topic = '';

return msg;

